// src/cfg/ydb/entrypoint.sh
var entrypoint_default = "#!/bin/bash\n\nset -e\n\n# =============================================================================\n# YDB Docker Entrypoint Script\n# =============================================================================\n#  entrypoint    YDB   init \n# =============================================================================\n\n#     timestamp\nlog() {\n    echo \"[$(date '+%Y-%m-%d %H:%M:%S')] $1\"\n}\n\n#  bootstrap  YDB\nperform_cluster_bootstrap() {\n    log \"Running cluster bootstrap...\"\n\n    #   broker  YDB_NODE_BROKERS  fallback\n    local storage_endpoint\n    if [[ -n \"$YDB_NODE_BROKERS\" ]]; then\n        storage_endpoint=$(echo \"$YDB_NODE_BROKERS\" | cut -d',' -f1)\n    else\n        storage_endpoint=\"grpc://localhost:2136\"\n    fi\n\n    log \"Bootstrapping cluster with endpoint: $storage_endpoint\"\n    exec /ydb -e \"$storage_endpoint\" -y admin cluster bootstrap --uuid test\n}\n\n#    YDB\nperform_database_creation() {\n    log \"Creating database...\"\n\n    #   broker  YDB_NODE_BROKERS  fallback\n    local storage_endpoint\n    if [[ -n \"$YDB_NODE_BROKERS\" ]]; then\n        storage_endpoint=$(echo \"$YDB_NODE_BROKERS\" | cut -d',' -f1)\n    else\n        storage_endpoint=\"grpc://localhost:2136\"\n    fi\n\n    local database_path=\"${YDB_DATABASE_PATH:-/Root/testdb}\"\n    log \"Creating database '$database_path' with endpoint: $storage_endpoint\"\n    exec /ydbd -s \"$storage_endpoint\" admin database \"$database_path\" create ssd:1\n}\n\n#     \nprepare_block_device() {\n    local config_path=\"${YDB_CONFIG_PATH:-/opt/ydb/cfg/config.yaml}\"\n    local disk_path=\"${YDB_DISK_PATH:-/tmp/pdisk.data}\"\n\n    log \"Checking if block device preparation is needed...\"\n\n    # ,   in-memory \n    if [[ \"${YDB_USE_IN_MEMORY_PDISKS:-false}\" == \"true\" ]]; then\n        log \"In-memory mode detected (YDB_USE_IN_MEMORY_PDISKS=true), skipping block device creation\"\n        return 0\n    fi\n\n    # ,       \n    if [[ -n \"$YDB_DISK_PATH\" ]]; then\n        disk_path=\"$YDB_DISK_PATH\"\n        log \"Using user-provided disk path: $disk_path\"\n    fi\n\n    # ,     \n    if [[ -f \"$disk_path\" ]]; then\n        log \"Disk file already exists at $disk_path, skipping creation\"\n        return 0\n    fi\n\n    log \"Creating block device at $disk_path...\"\n\n    #    \n    mkdir -p \"$(dirname \"$disk_path\")\"\n\n    #   \n    dd if=/dev/zero of=\"$disk_path\" bs=1M count=2048\n\n    log \"Obliterating disk at $disk_path...\"\n    /ydbd admin bs disk obliterate \"$disk_path\"\n\n    log \"Block device prepared successfully\"\n}\n\n#   YDB  (storage  database)\nstart_ydb_node() {\n    #  \n    local node_type=\"${YDB_NODE_TYPE:-static}\"\n    local node_location_dc=\"${YDB_NODE_LOCATION_DC}\"\n    local node_location_rack=\"${YDB_NODE_LOCATION_RACK}\"\n\n    local config_path=\"${YDB_CONFIG_PATH:-/opt/ydb/cfg/config.yaml}\"\n    local grpc_port=\"${YDB_GRPC_PORT:-2136}\"\n    local mon_port=\"${YDB_MON_PORT:-8765}\"\n    local ic_port=\"${YDB_IC_PORT:-19001}\"\n\n    #   /opt/ydb/cfg_dir   \n    mkdir -p /opt/ydb/cfg_dir\n\n    #   \n    local ydb_args=(\n        \"/ydbd\"\n        \"server\"\n        \"--yaml-config\" \"$config_path\"\n        \"--config-dir\" \"/opt/ydb/cfg_dir\"\n        \"--grpc-port\" \"$grpc_port\"\n        \"--mon-port\" \"$mon_port\"\n        \"--ic-port\" \"$ic_port\"\n    )\n\n    #  --node   storage  ( tenant)\n    if [[ -z \"$YDB_TENANT\" ]]; then\n        #     storage \n        prepare_block_device\n        ydb_args+=(\"--node\" \"$node_type\")\n    fi\n\n    #  tenant  \n    if [[ -n \"$YDB_TENANT\" ]]; then\n        ydb_args+=(\"--tenant\" \"$YDB_TENANT\")\n    fi\n\n    if [[ -n \"$YDB_NODE_LOCATION_DC\" ]]; then\n        ydb_args+=(\"--data-center\" \"$node_location_dc\")\n    fi\n\n    if [[ -n \"$YDB_NODE_LOCATION_RACK\" ]]; then\n        ydb_args+=(\"--rack\" \"$node_location_rack\")\n    fi\n\n    #  node brokers  \n    if [[ -n \"$YDB_NODE_BROKERS\" ]]; then\n        IFS=',' read -ra brokers <<< \"$YDB_NODE_BROKERS\"\n        for broker in \"${brokers[@]}\"; do\n            ydb_args+=(\"--node-broker\" \"$broker\")\n        done\n    fi\n\n    #  bridge pile name  \n    if [[ -n \"$YDB_BRIDGE_PILE_NAME\" ]]; then\n        ydb_args+=(\"--bridge-pile-name\" \"$YDB_BRIDGE_PILE_NAME\")\n    fi\n\n    log \"Starting YDB with: ${ydb_args[*]}\"\n    exec \"${ydb_args[@]}\"\n}\n\n#  \nif [[ \"$1\" == \"/ydbd\" || \"$1\" == \"ydbd\" || -n \"$YDB_INIT_OPERATION\" ]]; then\n    #  init \n    case \"$YDB_INIT_OPERATION\" in\n        \"bootstrap\")\n            perform_cluster_bootstrap\n            ;;\n        \"create-database\")\n            perform_database_creation\n            ;;\n        \"\")\n            #   YDB node\n            start_ydb_node\n            ;;\n        *)\n            log \"Unknown init operation: $YDB_INIT_OPERATION\"\n            exit 1\n            ;;\n    esac\nelse\n    #    YDB ,   \n    log \"Executing command: $*\"\n    exec \"$@\"\nfi\n";

// src/pulls.ts
var import_core = __toESM(require_core(), 1);
var import_github = __toESM(require_github2(), 1);
async function getPullRequestNumber() {
  let token = import_core.getInput("github_token") || process.env.GITHUB_TOKEN;
  let prNumber = import_core.getInput("github_pull_request_number");
  if (prNumber.length > 0) {
    return parseInt(prNumber);
  }
  if (import_github.context.eventName === "pull_request") {
    return import_github.context.payload.pull_request.number;
  }
  if (token) {
    let octokit = import_github.getOctokit(token);
    let branch = import_github.context.ref.replace("refs/heads/", "");
    const { data: pulls } = await octokit.rest.pulls.list({
      state: "open",
      owner: import_github.context.repo.owner,
      repo: import_github.context.repo.repo,
      head: `${import_github.context.actor}:${branch}`
    });
    if (pulls.length > 0) {
      return pulls[0].number;
    }
  }
  return null;
}

// src/constants.ts
var HOST = "localhost";
var YDB_GRPC_PORT = 2135;
var YDB_TENANT = "/Root/testdb";
var PROMETHEUS_PORT = 9090;
var PROMETHEUS_PUSHGATEWAY_PORT = 9091;
var YDB_ENDPOINT = `grpc://${HOST}:${YDB_GRPC_PORT}`;
var YBD_CONNECTION_STRING = `${YDB_ENDPOINT}${YDB_TENANT}`;
var PROMETHEUS_URL = `http://${HOST}:${PROMETHEUS_PORT}`;
var PROMETHEUS_PUSHGATEWAY_URL = `http://${HOST}:${PROMETHEUS_PUSHGATEWAY_PORT}`;

// src/main.ts
async function main() {
  let cwd = path.join(process.cwd(), ".slo");
  let workload = import_core2.getInput("workload_name") || import_core2.getInput("sdk_name") || "unspecified";
  import_core2.saveState("cwd", cwd);
  import_core2.saveState("workload", workload);
  import_core2.debug("Creating working directory...");
  fs.mkdirSync(cwd, { recursive: true });
  PR: {
    import_core2.info("Aquire pull request number...");
    let prNumber = await getPullRequestNumber() || -1;
    import_core2.info(`Pull request number: ${prNumber}`);
    if (prNumber < 0) {
      break PR;
    }
    import_core2.saveState("pull", prNumber);
    import_core2.info("Writing pull number...");
    let pullPath = path.join(cwd, `${workload}-pull.txt`);
    fs.writeFileSync(pullPath, prNumber.toFixed(0), { encoding: "utf-8" });
    import_core2.info(`Pull number written to ${pullPath}`);
    let artifactClient = new import_artifact.DefaultArtifactClient;
    import_core2.info("Upload pull number as an artifact...");
    let { id } = await artifactClient.uploadArtifact(`${workload}-pull.txt`, [pullPath], cwd, { retentionDays: 1 });
    import_core2.info(`Pull number uploaded as an artifact ${id}`);
  }
  {
    import_core2.info("Writing ydb deployment configs...");
    let configPath = path.join(cwd, "ydb-config.yml");
    let configContent = ydb_config_default.replaceAll("{{ host }}", HOST);
    let deploymentPath = path.join(cwd, "compose.ydb.yaml");
    let deploymentContent = compose_default3.replaceAll("{{ host }}", HOST);
    let dockerFilePath = path.join(cwd, "Dockerfile");
    let dockerFileContent = Dockerfile_default.replaceAll("{{ host }}", HOST);
    let entrypointPath = path.join(cwd, "entrypoint.sh");
    let entrypointContent = entrypoint_default.replaceAll("{{ host }}", HOST);
    fs.writeFileSync(dockerFilePath, dockerFileContent, { encoding: "utf-8" });
    fs.writeFileSync(entrypointPath, entrypointContent, { encoding: "utf-8", mode: 493 });
    fs.writeFileSync(configPath, configContent, { encoding: "utf-8" });
    fs.writeFileSync(deploymentPath, deploymentContent, { encoding: "utf-8" });
    import_core2.info(`Created config for ydb: ${configPath}`);
    import_core2.info(`Created deployment for ydb: ${deploymentPath}`);
    import_core2.info(`Created Dockerfile for ydb: ${dockerFilePath}`);
    import_core2.info(`Created entrypoint for ydb: ${entrypointPath}`);
  }
  {
    import_core2.info("Creating prometheus deployment configs...");
    let configPath = path.join(cwd, "prometheus.yml");
    let configContent = prometheus_default.replace("{{ pushgateway }}", `${HOST}:${PROMETHEUS_PUSHGATEWAY_PORT}`);
    let deploymentPath = path.join(cwd, "compose.prometheus.yaml");
    let deploymentContent = compose_default2.replace("{{ pushgateway }}", `${HOST}:${PROMETHEUS_PUSHGATEWAY_PORT}`);
    fs.writeFileSync(configPath, configContent, { encoding: "utf-8" });
    fs.writeFileSync(deploymentPath, deploymentContent, { encoding: "utf-8" });
    import_core2.info(`Created config for prometheus: ${configPath}`);
    import_core2.info(`Created deployment for prometheus: ${deploymentPath}`);
  }
  {
    import_core2.info("Creating chaos testing deployment configs...");
    let scriptPath = path.join(cwd, "run-chaos.sh");
    let scriptContent = run_chaos_default.replace("{{ host }}", HOST);
    let deploymentPath = path.join(cwd, "compose.chaos.yaml");
    let deploymentContent = compose_default.replace("{{ host }}", HOST);
    fs.writeFileSync(scriptPath, scriptContent, { encoding: "utf-8", mode: 493 });
    fs.writeFileSync(deploymentPath, deploymentContent, { encoding: "utf-8" });
    import_core2.info(`Created chaos script: ${scriptPath}`);
    import_core2.info(`Created deployment for chaos: ${deploymentPath}`);
  }
  import_core2.info("Starting YDB...");
  try {
    await import_exec.exec(`docker`, [
      `compose`,
      `-f`,
      `compose.ydb.yaml`,
      `-f`,
      `compose.chaos.yaml`,
      `-f`,
      `compose.prometheus.yaml`,
      `up`,
      `-d`
    ], { cwd });
  } catch (err) {
    import_core2.error(`Failed to start YDB: ${err}`);
    await import_exec.getExecOutput(`docker`, [`compose`, `-f`, `compose.ydb.yaml`, `logs`, `storage-zone-a-1`], {
      cwd
    });
    await import_exec.getExecOutput(`docker`, [`compose`, `-f`, `compose.ydb.yaml`, `logs`, `storage-zone-b-1`], {
      cwd
    });
    throw new Error(`Failed to start YDB: ${err}`);
  }
  let start = new Date;
  import_core2.info(`YDB started at ${start}`);
  import_core2.saveState("start", start.toISOString());
}
main();
